onload = function(){	
	//console.log(initGrid(144));
	game.timer = setInterval(function(){tick()}, Math.floor(1000/60));
	game.delimiter = 10;
	game.ticks = 0;
	// 0:unpaused  1:request to pause  2: paused
	game.pause = 0;
	game.offX = 60;
	game.offY = 50;
	game.zoomI = 1;
	game.zooms = [//[600,375,64,16],
			  [600,375,32,0],
			  [600,375,16,0],
			  [600,375,8,0],
			  [600,375,4,0]];
	game.vfx = new Vfx();
	let stats = {
		socialD: 10,
		randomSize: 0
	};
	game.player = new Player(stats);
	game.canvas = document.getElementById("canvas");
	//game.canvasMenu = document.getElementById("canvasMenu");
	game.ctx = game.canvas.getContext("2d");
	//game.ctxMenu = game.canvasMenu.getContext("2d");
	game.width = game.canvas.getAttribute('width');
	game.height = game.canvas.getAttribute('height');
	console.log('window onload triggered');
	//document.getElementById("zOutBut").value = ''+(game.zoomI + 2)+'';
	//document.getElementById("zInBut").value = ''+(game.zoomI)+'';
	createGame(game.zooms[game.zoomI],0);
	game.vfx.canvasMenu.onmousemove = function (e) {
   let loc = windowToCanvas(game.vfx.canvasConway, e.clientX, e.clientY);
	showAtMouse(loc.x,loc.y,'mOver');
	};
	game.vfx.canvasMenu.onmouseup = function (e) {
   let loc = windowToCanvas(game.vfx.canvasConway, e.clientX, e.clientY);
	showAtMouse(loc.x,loc.y,'mClick');
	};
	
}
function tick(){
	if( game.pause == 2){
		
	}else{
		
		//menu operations
		//game.vfx.drawComponents();
		//conway cycle operations
		if (game.ticks % game.delimiter == 0){
			if ( game.pause == 1){
			game.pause = 2;
			}
			game.conway.runCycle();
		}
		if(game.ticks >= 90000){
			game.ticks = 1;
		}else{
			game.ticks++;
		}
	}
}
function createGame([width,height,shapeSize,spacer],pause){	
	game.grid = new Grid(width,height,shapeSize,spacer,1);
	game.conway = new Conway();
	game.pause = pause;
	console.log('createGame: zoom='+game.zoomI);
}
function windowToCanvas(canvas, x, y) {
   var bbox = canvas.getBoundingClientRect();
   return { x: x - bbox.left * (canvas.width  / bbox.width),
            y: y - bbox.top  * (canvas.height / bbox.height)
          };
}

function showAtMouse(x,y,mAction){
	//document.getElementById("zOutBut").value = ''+x+'';
	//document.getElementById("zInBut").value = ''+y+'';
	
	for (let menu of game.vfx.menus){
		//console.log(comp.name + ' ' + comp.x + ',' + comp.y);
		if((menu.name == game.vfx.visibleMenu) || (menu.name == 'hud')){
			for (let comp of menu.components){
				//console.log(comp.name + ' ' + comp.x + ',' + comp.y);
				if(((x >= comp.x) && (x <= comp.x + comp.width)) &&	((y >= comp.y) && (y <= comp.y + comp.height))){
					comp.update(mAction);
					console.log('over ' + comp.name);
				}else{
					if(comp.isMOver && (mAction == 'mOver')){
						console.log('out '+ comp.name);
						comp.update('mOut');
					}
				}
			}
		}
	}
	for(let s of game.conway.liveShapes){
		if ((s.x <=x && s.x+s.size >= x) && (s.y <=y && s.y+s.size >= y)){
				console.log(' Creature: '+s.creature.name);
		}
	}
}
